svg.script:

var no = 0;
setInterval(function () {
	var cur = Math.floor(Math.random() * 19 + 6);
	if (no < cur) {
		var timer = setInterval(function () {
			if (no < cur) {
				document.getElementsByClassName("st" + no)[0].setAttribute("opacity",1)
				no++;
			} else {
				clearInterval(timer)
			}
		}, 100)
	} else {
		var timer = setInterval(function () {
			if (no > cur) {
				document.getElementsByClassName("st" + no)[0].setAttribute("opacity",0.5)
				no--;
			} else {
				clearInterval(timer)
			}
		}, 100)
	}
}, 1800)
